<h5>ED-00028: APA Election Data</h5>
<p>This dataset contains the results of the elections of the American Psychological Association between 1998 - 2009.  The voters are allowed to rank any number of the 5 candidates without ties.  Each of these elections have 5 candidates and between 13,318 and 20,239 voters.</p><p>These data were donated by Michal Regenwetter and Anna Popova from the University of Illinois at Urbana-Champaign.  The work that analyzed this data was supported by National Science Foundation grants SES # 08-20009, ICES # 1216016 (PI: M. Regenwetter), the University Library at the University of Illinois at Urbana-Champaign (PI: A. Popova), and the Basic Research Program at HSE (S. Popov). We thank the American Psychological Association for permitting access to its election ballot data. More information and tools for analyzing this data can be found at the website of the <a href="http://regenwetterlab.org/software/consensus/">Decision Making Laboratory at the University of Illinois</a>.</p>

<p><h6>Required Citations</h6><p><ul> 
<li> <a href="http://scholar.google.com/scholar?as_q=The+unexpected+empirical+consensus+among+consensus+methods">The unexpected empirical consensus among consensus methods.</a> Regenwetter, M., Kim, A., Kantor, A., & Ho, M.-H. R.. Psychological Science, 18, 629-635, 2007. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=Behavioural+social+choice:+A+status+report">Behavioural social choice: A status report.</a> Regenwetter, M., Grofman, B., Popova, A., Messner, W., Davis-Stober, C. & Cavagnaro, D.. Philosophical Transactions of the Royal Society B: Biological Sciences, 364, 833-843, 2009. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=Consensus+formation+in+organizations:+Hunting+for+the+social+choice+conundrum+in+American+Psychological+Association+elections">Consensus formation in organizations: Hunting for the social choice conundrum in American Psychological Association elections.</a> Popov, S., Popova, A., Regenwetter, M.. Decision, 2015. </li>
</ul></p>

